CREATE TABLE `critiques` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(128) NOT NULL COMMENT 'Заголовок рецензии',
  `body` text NOT NULL COMMENT 'Текст',
  `user_id` int unsigned NOT NULL COMMENT 'Автор рецензии, зарегистрированный пользователь',
  `movie_id` bigint unsigned NOT NULL COMMENT 'Объект рецензии',
  `assessment` tinyint NOT NULL COMMENT '10 из 10',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата добавления записи',
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата обновления записи',
  PRIMARY KEY (`id`),
  UNIQUE KEY `critiques_uq` (`user_id`,`movie_id`),
  KEY `critiques_movies_fk` (`movie_id`),
  CONSTRAINT `critiques_movies_fk` FOREIGN KEY (`movie_id`) REFERENCES `movies` (`id`) ON DELETE CASCADE,
  CONSTRAINT `critiques_users_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
