DROP TABLE IF EXISTS `movies`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `movies` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `rating` decimal(4,2) unsigned DEFAULT NULL COMMENT 'Рейтинг',
  `name` varchar(128) NOT NULL COMMENT 'Наименование фильма',
  `original_name` varchar(128) NOT NULL COMMENT 'Оригинальное наименование фильма',
  `poster` mediumblob COMMENT 'Постер',
  `production_year` year DEFAULT NULL COMMENT 'Год производства',
  `genre` set('Аниме','Биографический','Боевик','Вестерн','Военный','Детектив','Детский','Документальный','Драма','Исторический','Комедия','Мелодрама','Мистика','Мультфильм','Мюзикл','Научный','Приключения','Триллер','Ужасы','Фантастика','Фэнтези') DEFAULT NULL COMMENT 'Жанр',
  `tagline` varchar(128) DEFAULT NULL COMMENT 'Слоган',
  `budget` int DEFAULT NULL COMMENT 'Бюджет',
  `earnings` int DEFAULT NULL COMMENT 'Сборы',
  `premiere_at` date DEFAULT NULL COMMENT 'Премьера',
  `dvd_release` varchar(128) DEFAULT NULL COMMENT 'Релиз на DVD',
  `blue_ray_release` varchar(128) DEFAULT NULL COMMENT 'Релиз на Blu-ray',
  `age` tinyint NOT NULL COMMENT 'Возраст',
  `mpaa_rating_id` int unsigned NOT NULL COMMENT 'Система рейтингов американской киноассоциации',
  `duration` int DEFAULT NULL COMMENT 'Время в минутах',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата добавления записи',
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата обновления записи',
  PRIMARY KEY (`id`),
  KEY `movies_mpaa_ratings_fk` (`mpaa_rating_id`),
  KEY `movies_name_original_name_ix` (`name`,`original_name`),
  CONSTRAINT `movies_mpaa_ratings_fk` FOREIGN KEY (`mpaa_rating_id`) REFERENCES `mpaa_ratings` (`id`),
  CONSTRAINT `movies_rating_chk` CHECK ((`rating` <= 10))
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

