INSERT INTO `mpaa_ratings` VALUES (1,'G','General audiences','Фильм демонстрируется без ограничений. Данный рейтинг показывает, что оценённый фильм не содержит ничего, что большинство родителей могло бы посчитать неприемлемым для просмотра или прослушивания даже самыми маленькими детьми. Обнажение, сексуальные сцены и сцены приёма наркотиков отсутствуют; насилие минимально; могут употребляться выражения, выходящие за пределы вежливой беседы, но только те, которые постоянно встречаются в повседневной речи. Более грубая лексика в фильмах с рейтингом G употребляться не может.'),(2,'PG','Parental guidance suggested','Детям рекомендуется смотреть фильм с родителями. Некоторые материалы могут не подходить для детей. Этот рейтинг показывает, что родители могут найти некоторые из сцен в фильме неподходящими для детей и что родителям рекомендуется посмотреть фильм, прежде чем показывать его детям. Явные сексуальные сцены и сцены употребления наркотиков отсутствуют; нагота, если присутствует, только в очень ограниченной степени, могут быть использованы лёгкие ругательства и представлены сцены насилия, но только в очень умеренных количествах.'),(3,'PG-13','Parental guidance suggested','Просмотр не желателен детям до 13 лет. Данный рейтинг показывает, что оценённый фильм может быть неподходящим для детей. Родители должны быть особенно осторожны, разрешая своим маленьким детям просмотр. Может присутствовать умеренное или грубое насилие; могут присутствовать сцены с наготой; возможны ситуации с сексуальным контекстом; могут присутствовать некоторые сцены употребления наркотиков; можно услышать единичные употребления грубых ругательств.'),(4,'R','Restricted','Лица, не достигшие 17-летнего возраста, допускаются на фильм только в сопровождении одного из родителей, либо законного представителя. Данный рейтинг показывает, что оценочная комиссия заключила, что некоторый материал оценённого фильма предназначается только для взрослых. Родители должны больше узнать о фильме, прежде чем взять на его просмотр подростков. Рейтинг R может быть назначен из-за частого употребления непристойной лексики, продолжительных сцен насилия, полового акта или употребления наркотиков.'),(5,'NC-17','No One 17 & Under Admitted','Лица 17-летнего возраста и младше на фильм не допускаются. Данный рейтинг показывает, что оценочная комиссия полагает, что по мнению большинства родителей фильм явно для взрослых, и детей до 17 лет нельзя допускать до просмотра. Фильм может содержать явные сексуальные сцены, большое количество непристойной и сексуальной лексики, или сцен чрезмерного насилия. Рейтинг NC-17, однако, ещё не означает, что данный фильм является непристойным или порнографическим, как в повседневном, так и в юридическом смысле этих слов.');
/*!40000 ALTER TABLE `mpaa_ratings` ENABLE KEYS */;
