DROP TABLE IF EXISTS `persons`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `persons` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `first_name` varchar(128) NOT NULL COMMENT 'Имя',
  `middle_name` varchar(128) DEFAULT NULL COMMENT 'Отчество, второе имя',
  `last_name` varchar(128) NOT NULL COMMENT 'Фамилия',
  `heighth` tinyint unsigned DEFAULT NULL COMMENT 'Рост в см.',
  `photo` mediumblob COMMENT 'Фото',
  `birth_date` date DEFAULT NULL COMMENT 'Дата рождения',
  `birth_place` varchar(128) DEFAULT NULL COMMENT 'Место рождения',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата добавления записи',
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Дата обновления записи',
  PRIMARY KEY (`id`),
  KEY `persons_first_last_middle_ix` (`first_name`,`last_name`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

